import React from 'react';
import {Routes, Route } from 'react-router-dom';
import Inicio from './components/Inicio';
import Pokemon from './components/Pokemon';
import './App.css';

function App() {
  return (
      <Routes>
      <div className="App">
        <Route path="/" element={<Inicio />}/>
        <Route path="/pokemon" element={<Pokemon />}/>
      </div>
      </Routes>

  );
}

export default App;
